// import logo from './logo.svg';
import './App.css';
import { Container } from 'react-bootstrap';
import NavBar from './Navbar';

import { BrowserRouter} from "react-router-dom";
import {useEffect, useState } from 'react';



function App() {
  const [fetching, setfetching] = useState(false);

  const [data, setdata] = useState([])


  const load = () => {
    setfetching(true);
    fetch('http://localhost:8000/api/all/?format=json')
      .then(res => res.json()).then(res => {
        setdata(res)
        // console.log(res)
    })
    setfetching(false);
  }

  useEffect(() => {

    load();
  },[])


  return (
    <BrowserRouter>
      <div className="App">
          <NavBar />
          <Container>
          <div>
            {!fetching && data.map((item, i) => {
              console.log(i);
              return (<p key="{i}">{item.name}</p>)
            })
            }
            </div>
          </Container>
        </div>
      </BrowserRouter>
  );
}

export default App;
